import React from 'react';
import '../styles/About.css';

function About() {
  return (
    <section id="about" className="about-section">
      <h2>About Me</h2>
      <p>- Software Engineer</p>
      <p>- Computer Science Student</p>
      <p>- Teacher</p>
      {/* Add more content as needed */}
    </section>
  );
}

export default About;
